/* (Author: Tytrez Dixon; Date 1/26/2025) This is the .tsx file for a vehicle entry component for the
information system. This component consists of the image of the vehicle, basic
information regarding the vehicle, and the "view details" button. This function
is used in the "VehicleList.tsx" file.

NOTE: THIS FILE WILL BE MODIFIED LATER TO ACCOMODATE THE VEHICLE DATABASE!

*/

import React from "react";

export function VehicleEntry () {
    return (
        <div>

            {/* Image of the vehicle. */}
            <img
                src = "https://www.carscoops.com/wp-content/uploads/webp/2022/12/2022-Jaguar-XE.webp"
                width = {250}
                height = {250}    
                >
            </img>

            <div>
                {/* NOTE: THIS SECTION OF CODE WILL BE CHANGED LATER TO DISPLAY ACTUAL INFO! */}
                <p>
                    [General info]
                </p>
            </div>

            {/* Upon the salespersons' clicking of this button, they will be navigated
            to a "View Details" page where the user will be able to see more 
            detailed vehicle info. 

            NOTE: THIS CODE WILL BE MODIFIED TO INCLUDE AN ONCLICK FUNCTION! */}
            <div className = "button hover:">
                <p>
                    View Details
                </p>
            </div>
        </div>

    )
}
